import React, { props } from "react";

export default function Kartica(props) {
  console.log(props);
  return (
    <div>
      <p>{props.osoba.title}</p>
      <img
        src={props.osoba.image}
        style={{ display: "block", maxWidth: "10%", maxHeight: "10%" }}
        alt="slika"
      />
      <p>{props.osoba.price}</p>
    </div>
  );
}
